    body {
        margin: 0;

        height: 100vh;
    }
    .container {
        background: #111;
        padding: 30px;
        border-radius: 15px;
        box-shadow: 0 0 20px rgba(255, 255, 255, 0.1);
        width: 300px;
    }
    .status {
        display: flex;
        align-items: center;
        margin-bottom: 10px;
    }
    .status-dot {
        width: 10px;
        height: 10px;
        background-color: #00ff00;
        border-radius: 50%;
        margin-right: 10px;
    }
    .time {
        font-weight: bold;
        margin-bottom: 5px;
    }
    .fps {
        font-weight: bold;
        margin-bottom: 20px;
        font-size: 13px;
        color: #00ff00;
    }
    .option {
        display: flex;
        align-items: center;
        margin-bottom: 10px;
    }
    .option input[type="radio"] {
        margin-right: 10px;
    }
    .coder {
        margin-top: 20px;
        font-style: italic;
        font-size: 12px;
        color: #aaa;
        text-align: right;
    }

<script>
    let audioSuccess;

    function updateTime() {
        const now = new Date();
        const timeString = now.toLocaleTimeString('vi-VN', { hour12: false });
        document.getElementById('time').textContent = timeString;
    }
    setInterval(updateTime, 1000);
    window.onload = () => {
        updateTime();
        audioSuccess = new Audio("https://media.vocaroo.com/mp3/1e5AK7SU7jKE");
    };

    // FPS Counter
    let fps = 0, lastFpsUpdate = performance.now();
    function fpsCounter() {
        fps++;
        const now = performance.now();
        if (now - lastFpsUpdate >= 1000) {
            document.getElementById('fps').textContent = `FPS: ${fps}`;
            fps = 0;
            lastFpsUpdate = now;
        }
        requestAnimationFrame(fpsCounter);
    }
    requestAnimationFrame(fpsCounter);
